import React from 'react';
import s from './Navigation.module.css'

const Navigation = () => {
    return (
        <nav className={s.mainNav}>
            <h2 class="text-lg font-bold">СамГТУ</h2>

            <div className={s.listContact}>
                <a href='/'>О нас</a>
                <a href='/'>Контакты</a>
            </div>
        </nav>
    );
}

export default Navigation;
